import React from 'react';

function LikeBtn({ handleClickAside, likeCount }) {
	return (
		<div className="reaction">
			<button
				onClick={(e) => {
					handleClickAside(e, 'like');
				}}
				className="likes"
				type="button"
			>
				<i className="icon-heart" />
				<span>{likeCount}</span>
			</button>
		</div>
	);
}

export default LikeBtn;
